class Solution {
public:
    vector<int> minReverseOperations(int n, int p, vector<int>& banned, int k) {
        vector<int> r(n, -1);
        r[p] = 0;
        if (k == 1 || n == 1) {
            return r;
        }
        unordered_set<int> all;
        for (int i = 0; i < n; ++i) {
            all.insert(i);
        }
        all.erase(p);
        for (int x : banned) {
            all.erase(x);
        }
        vector<set<int>> s(2);
        for (int x : all) {
            s[x & 1].insert(x);
        }
        queue<int> q;
        for (q.push(p); !q.empty(); ) {
            p = q.front();
            q.pop();
            // left side:  x 
            // right side: (k - 1 - x)
            //  p + k - n <= x <= p
            // max(0, p + k - n) <= x <= min(p, k - 1)
            const int left = max(0, p + k - n), right = min(p, k - 1);
            if (left > right) {
                continue;
            }
            const int v1 = k + p - 1 - right - right;
            const int v2 = k + p - 1 - left - left;
            const int ind = v1 & 1;
            for (auto t = s[ind].lower_bound(v1); t != s[ind].end(); ) {
                if (*t > v2) {
                    break;
                }
                r[*t] = r[p] + 1;
                q.push(*t);
                s[ind].erase(t++);
            }
            
        }
        return r;
        
    }
};


